import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header>
      <h1>Clothing Store</h1>
      <nav>
        <a href="/">Home</a>
        <a href="/cart">Cart</a>
      </nav>
    </header>
  );
};

export default Header;
